import React from 'react';
import Link from 'Link.js';

class Report extends React.Component {
    render() {
        return (
            <div className="report-page">
                <h5>REPORT PAGE</h5>
                <Link to="/reports/week/1" text="Week1" className="report_week_link" />
            </div>
        )
    }
}

export default Report;
